The reduce implementation is essentially copypasta. It handles resolving and dispatching to a handler with a new state clone. The handler resolution and dispatch logic should be split to facilitate clean unit testing. pub fn reduce( old_state: Arc<FooState>, action_wrapper: &ActionWrapper, action_channel: &Sender<ActionWrapper>, observer_channel: &Sender<Observer>,
) -> Arc<AgentState> { let handler = resolve_action_handler(action_wrapper); match handler { Some(f) => { let mut new_state: FooState = (*old_state).clone(); f(&mut new_state, &action_wrapper, action_channel, observer_channel); Arc::new(new_state) } None => old_state, }
}

