Each handler should respond to one action signal and mutate the relevant state. The standard pattern is to maintain a HashMap of incoming action wrappers against the result of their action from the perspective of the current module. Each action wrapper has a unique id internally so there will be no key collisions. fn handle_foo( state: &mut FooState, action_wrapper: &ActionWrapper, _action_channel: &Sender<ActionWrapper>, _observer_channel: &Sender<Observer>,
) { let action = action_wrapper.action(); let bar = unwrap_to!(action => Action::Bar); // do something with bar... let result = bar.do_something(); state .actions .insert(action_wrapper.clone(), ActionResponse::Bar(result.clone()));
} WARNING: Actions are reduced in a simple loop. Holochain will hang if you dispatch and block on a new action while an outer action reduction is also blocking, waiting for a response.

