instance::Instance has a state::State which is the one global state. Each stateful module has a state.rs module containing sub-state slices. See src/agent/state.rs and src/nucleus/state.rs and how they are put together in src/state.rs . State is read from the instance through relevant getter methods: instance.state().nucleus().dna() and mutated by dispatching an action: let entry = Entry::App( ... );
let action_wrapper = ActionWrapper::new(&Action::Commit(entry));
instance.dispatch(action_wrapper); Instance calls reduce on the state with the next action to consume: pub fn consume_next_action(&mut self) { if self.pending_actions.len() > 0 { let action = self.pending_actions.pop_front().unwrap(); self.state = self.state.clone().reduce(&action); }
} The main reducer creates a new State object and calls the sub-reducers: pub fn reduce(&mut self, action_wrapper: &ActionWrapper) -> Self { let mut new_state = State { nucleus: ::nucleus::reduce( ... ), agent: ::agent::reduce( ... ) } new_state.history.insert(action_wrapper); new_state
} Each incoming action wrapper is logged in the main state history to facilitate testing and "time travel" debugging. Sub-module state slices are included in state::State as counted references. The sub-module reducer must choose to either: If mutations happen, return a cloned, mutated state slice with a new reference If no mutations happen, return the reference to the original state slice The reduce copypasta above demonstrates this as the possible return values. Redux in Rust code was used as a reference from this repository .

