There is a conceptual change to the approach to validation of entries, and even whereabouts that logic lives in the code. In holochain-proto , there were a number of hooks which Holochain would call back into, to perform validation, such as validateCommit validatePut validateMod validateDel validateLink Regardless of how many entry types there were, there would still be only 5 callbacks defined maximum. These validation callbacks were performed at a certain stage in the lifecycle of an entry. Now, an entry type is defined all in one place, including its validation rules, which are unique to it as an entry type. This could look as follows: #[derive(Serialize, Deserialize, Debug, DefaultJson)]
struct Person { name: String,
} entry!( name: "person", description: "", sharing: Sharing::Public, native_type: Person, validation_package: || { hdk::ValidationPackageDefinition::Entry }, validation: |person: Person, validation_data: hdk::ValidationData| { (person.name.len() >= 2) .ok_or_else(|| String::from("Name must be at least 2 characters")) }
) The callback validation , replaces validateCommit and all the rest from holochain-proto. However, validation still happens at various times in the lifecycle of an entry, so if the validation is to operate differently between initial commit to the chain, update , or remove , then that logic must be written into this single validation function. To determine which context validation is being called within, you can check in a property of the second parameter of the callback, which in the example above is called validation_data . For this, you can use the Rust match operator, and check against the validation_data.action . It will be one of an enum that can be seen in detail in the API reference .
